func cordic (le fixed.Int26_6) fixed.Int26_6{
	
		theta := [10]fixed.Int26_6{	155, 132, 109, 86, 62, 35, 16, 8, 4, 2,  }
		two_pow := [10]fixed.Int26_6{63, 62, 60, 56, 48, 32, 16, 8, 4, 2, }
		if le > 8{
			return 1 
		}
		if le < -8{
			return -1 
		}
		//x0 = sinh(0) and y0 = cosh(0)
	    var x fixed.Int26_6 = 0
	    var y fixed.Int26_6 = 1
	    var alpha fixed.Int26_6 = 1
		var xj fixed.Int26_6 = x
		var yj fixed.Int26_6 = y

		for i := 0; i < 1; i++{
			alpha = 1
			if le < 0{
				alpha = -1
			}
			
			xj = x
			yj = y
			x = xj + alpha*two_pow[i] * yj
			y = yj + alpha*two_pow[i] * xj
			le = le - alpha*theta[i]	
		}
		//return (x / y)
		return le
	}

